DROP TABLE IF EXISTS userlog CASCADE;
DROP TABLE IF EXISTS trainer CASCADE;
DROP TABLE IF EXISTS member CASCADE;
DROP TABLE IF EXISTS payment CASCADE;
DROP TABLE IF EXISTS GymVisit CASCADE;
DROP TABLE IF EXISTS PersonalSessionBooking CASCADE;
DROP TABLE IF EXISTS PersonalSessionAttendance CASCADE;
DROP TABLE IF EXISTS GroupSessionBooking CASCADE;
DROP TABLE IF EXISTS GroupExercise CASCADE;
DROP TABLE IF EXISTS GroupSession CASCADE;
DROP TABLE IF EXISTS GroupSessionAttendance CASCADE;
DROP TABLE IF EXISTS Price CASCADE;
/*---------------------------------------------------------------------------------------------------------------------*/
CREATE TABLE price
(
	PaymentPlan varchar(50) PRIMARY KEY,
	Cost int NOT NULL
);
/*---------------------------------------------------------------------------------------------------------------------*/
/*---------------------------------------------------------------------------------------------------------------------*/
CREATE TABLE userlog
(
	UserID int NOT NULL,
	UserName varchar(20) NOT NULL,
	Password int NOT NULL,
	Role varchar(20) NOT NULL,
	PRIMARY KEY (UserID)
);
/*---------------------------------------------------------------------------------------------------------------------*/
/*---------------------------------------------------------------------------------------------------------------------*/
CREATE TABLE member(
MemberID int NOT NULL,
UserID int NOT NULL,
FirstName varchar(20) NOT NULL,
LastName varchar(20) NOT NULL,
Email varchar(100) NOT NULL,
DateOfBirth date NOT NULL,
JoinedDate date NOT NULL,
LeftDate date,
Photo bytea,
Note varchar(9000),
NewsLetterSubscription boolean,
MembershipExpiryDate date NOT NULL,
PaymentPlan varchar(100) NOT NULL,
PRIMARY KEY (MemberID),
FOREIGN KEY (UserID) REFERENCES userlog(UserID),
CONSTRAINT chk_date CHECK ((JoinedDate <= LeftDate))
);
/*---------------------------------------------------------------------------------------------------------------------*/
/*yearly*/
/*monthly*/
/*weekly*/
/*---------------------------------------------------------------------------------------------------------------------*/
CREATE TABLE trainer(
TrainerID int NOT NULL,
UserID int NOT NULL,
FirstName varchar(20) NOT NULL,
LastName varchar(20) NOT NULL,
Email varchar(50) NOT NULL,
DateOfBirth date NOT NULL,
JoinedDate date NOT NULL,
LeftDate date,
Photo bytea,
Description varchar(9000),
AvailabilityStartTime time NOT NULL,
AvailabilityEndTime time NOT NULL,
PRIMARY KEY (TrainerID),
FOREIGN KEY (UserID) REFERENCES userlog(UserID)
);
/*---------------------------------------------------------------------------------------------------------------------*/
/*---------------------------------------------------------------------------------------------------------------------*/
CREATE TABLE Payment(
PaymentID int NOT NULL,
MemberID int NOT NULL,
PaymentStatus varchar(20) NOT NULL,
PaidPrice decimal(5,2) NOT NULL,
PaymentDueDate date, --should be NOT NULL but will need to update all insert into values first
PaymentDate date,
PaymentPlan varchar(50),
PRIMARY KEY (PaymentID),
FOREIGN KEY (MemberID) REFERENCES member(MemberID),
FOREIGN KEY (PaymentPlan) REFERENCES price(PaymentPlan)
);
/*---------------------------------------------------------------------------------------------------------------------*/
/*---------------------------------------------------------------------------------------------------------------------*/
CREATE TABLE GymVisit(
GymVisitID int NOT NULL,
MemberID int NOT NULL,
GymVisitDate date NOT NULL,
GymVisitTime time NOT NULL,
PRIMARY KEY (GymVisitID),
FOREIGN KEY (MemberID) REFERENCES member(MemberID)
);
/*---------------------------------------------------------------------------------------------------------------------*/
/*---------------------------------------------------------------------------------------------------------------------*/
CREATE TABLE PersonalSessionBooking(
PersonalSessionBookingID int NOT NULL,
MemberID int NOT NULL,
TrainerID int NOT NULL,
PersonalSessionDate date NOT NULL,
PersonalSessionStartTime time NOT NULL,
PersonalSessionEndTime time NOT NULL,
Price decimal(5,2) NOT NULL,
Location varchar(100),
BookingDate date NOT NULL,
BookingTime time NOT NULL,
Note varchar(9000),
PaymentID int,
PRIMARY KEY (PersonalSessionBookingID),
FOREIGN KEY (MemberID) REFERENCES member(MemberID),
FOREIGN KEY (TrainerID) REFERENCES trainer(TrainerID),
FOREIGN KEY (PaymentID) REFERENCES Payment(PaymentID)
);
/*---------------------------------------------------------------------------------------------------------------------*/
/*---------------------------------------------------------------------------------------------------------------------*/
CREATE TABLE PersonalSessionAttendance(
PersonalSessionAttendanceID int NOT NULL,
MemberID int NOT NULL,
PersonalSessionBookingID int NOT NULL,
AttendanceStatus varchar(20),
PRIMARY KEY (PersonalSessionAttendanceID),
FOREIGN KEY (MemberID) REFERENCES member(MemberID),
FOREIGN KEY (PersonalSessionBookingID) REFERENCES PersonalSessionBooking(PersonalSessionBookingID)
);
/*---------------------------------------------------------------------------------------------------------------------*/
/*---------------------------------------------------------------------------------------------------------------------*/
CREATE TABLE GroupExercise(
GroupExerciseID int NOT NULL,
GroupClassName varchar(100) NOT NULL,
GroupClassStartDate date NOT NULL,
GroupClassEndDate date NOT NULL,
Description varchar(9000),
PRIMARY KEY (GroupExerciseID)
);
/*---------------------------------------------------------------------------------------------------------------------*/
/*---------------------------------------------------------------------------------------------------------------------*/
CREATE TABLE GroupSession(
GroupSessionID int NOT NULL,
GroupExerciseID int NOT NULL,
TrainerID int NOT NULL,
GroupSessionStartDate date NOT NULL,
GroupSessionStartTime time NOT NULL,
GroupSessionEndTime time NOT NULL,
Location varchar(50) NOT NULL,
PRIMARY KEY (GroupSessionID),
FOREIGN KEY (GroupExerciseID) REFERENCES GroupExercise(GroupExerciseID),
FOREIGN KEY (TrainerID) REFERENCES Trainer(TrainerID)
);
